import React, { useState } from "react";
import { Outlet, Link } from "react-router-dom";

export default function Menu() {
  const [links, setlinks] = useState([
    {
      Link: "فرصت های شغلی",
      To: "/",
    },
    {
      Link: "بلاگ",
      To: "/",
    },
    {
      Link: "باشگاه رانندگان",
      To: "/",
    },
    {
      Link: "ثبت نام راننده اسنپ",
      To: "/",
    },
    {
      Link: "پنل سازمانی",
      To: "/",
    },
    {
      Link: "درباره ما",
      To: "/",
    },
    {
      Link: "تماس با ما",
      To: "/About",
    },
  ]);

  return (
    <section className="w-2/3 h-full border border-red-600">
      <ul className="flex items-center justify-between w-full h-full">
        <li className="flex items-center justify-center w-full h-full"></li>
        {links.map((val, index) => {
          return (
            <Link key={index} className="text-white grow" to={val.To}>
              {val.Link}
            </Link>
          );
        })}
      </ul>
      <Outlet />
    </section>
  );
}
